  [],\n\t\"revision_timestamp\": \"2015-09-26T20:57:47.035429\",\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-national-weather-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer called the Sea Level Rise and Coastal
  Flooding Impacts Viewer. It depicts potential sea level rise and its associated
  impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
  coastal managers and scientists with a preliminary look at sea level rise (slr)
  and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
  consistent data sets and analyses. Data and maps provided can be used at several
  scales to help gauge trends and prioritize actions for different scenarios. The
  Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
  This metadata record describes the Charleston Weather Forecast Office (CHS WFO)
  digital elevation model (DEM), which is a part of a series of DEMs produced for
  the National Oceanic and Atmospheric Administration Office for Coastal Management's
  Sea Level Rise and Coastal Flooding Impacts Viewer described above. The DEMs created
  for this project were developed using the NOAA National Weather Service's Weather
  Forecast Office (WFO) boundaries. This DEM includes the best available lidar known
  to exist at the time of DEM creation that met project specifications for the Charleston
  WFO, which includes the coastal areas of the counties of Berkeley, Charleston, Colleton,
  Dorchester, Hampton, and Jasper. Beaufort County, while in the CHS WFO area, is
  not included in this DEM because the data is proprietary. The DEM was produced from
  the following lidar data sets: 1. 2010 USGS ARRA - South Carolina Coastal Plains
  Lidar: Allendale, Hampton, and Lee Counties 2. 2010 US Army Corps of Engineers (USACE)
  JALBTCX Topobathy Lidar: Southeast (NC, SC, GA, FL) 3. 2009 South Carolina Lidar
  Consortium Lidar: Charleston County (North and South portions of county) 4. 2009
  South Carolina Lidar Consortium Lidar: Berkeley County 5. 2009 South Carolina Lidar
  Consortium Lidar: Dorchester County 6. 2007 FEMA/NOAA/SC DNR Lidar: Charleston County
  (Central portion), Colleton County, and Jasper County Hydrographic breaklines were
  delineated from LiDAR intensity imagery generated from the LiDAR dataset. The final
  DEM is hydro flattened such that water elevations are less than or equal to -0.5
  meters. The DEM is referenced vertically to the North American Vertical Datum of
  1988 (NAVD88) with vertical units of meters and horizontally to the North American
  Datum of 1983 (NAD83). The resolution of the DEM is approximately 5 meters.\",\n\t\"license_title\":
